    using SafeERC20 for ERC20;
    using Address for address;
    using SafeMath for uint;

    struct User{
        uint256 amount;
        uint256 releasetime;
        bool isValid;
    }

    uint256 public PRICE;
    uint256 public MAX_BY_MINT;
    uint256 public left_elements;
    uint256 public freeze_period;
    uint256 public ratio;


    mapping(address => bool ) public investor;
    mapping(address => bool ) public claimed;
    mapping (address => User) public vest;

    address public baseToken;
    address public farmingToken;
    address public dev;

    event Deposit();
    event Claim();


    constructor() {
        dev = msg.sender;
    }

    function setParams(address _baseToken, address _farmingToken, uint256 _price, uint256 _buy_amount, uint256 _farmingToken_amount, uint _freeze_period) public {
        require(msg.sender == dev, "!dev");
        baseToken = _baseToken;
        farmingToken = _farmingToken;
        PRICE = _price;
        MAX_BY_MINT = _buy_amount;
        left_elements = _farmingToken_amount.div(MAX_BY_MINT);
        freeze_period = _freeze_period;
        ratio = 0;
    }

    modifier onlyEOA() {
        require(msg.sender == tx.origin, "!EOA");
        _;
    }

    function deposite() public onlyEOA {
        require(left_elements > 0, "sale out");
        require(!investor[msg.sender],"deposited");
        IERC20(baseToken).transferFrom(msg.sender, address(this), MAX_BY_MINT * PRICE *  10 ** (ERC20(baseToken).decimals()));
        investor[msg.sender] = true;
        left_elements = left_elements - 1;
        emit Deposit();
    }

    function claim() public onlyEOA {
        require(investor[msg.sender], "not investor");
        require(!claimed[msg.sender], "claimed");
        claimed[msg.sender] = true;
        IERC20(farmingToken).transfer(msg.sender, MAX_BY_MINT * 10 ** (ERC20(farmingToken).decimals()));
        emit Claim();
    }

    function withdraw(address _token) public {
        require(msg.sender == dev, "!dev");
        uint256 b = IERC20(_token).balanceOf(address(this));
        IERC20(_token).transfer(dev,b);
    }

    function buy(uint256 _amount) public onlyEOA {
        uint256 balance = IERC20(farmingToken).balanceOf(address(this));
        require(balance > _amount, "amount exceed");
        IERC20(baseToken).transferFrom(msg.sender, address(this), _amount * PRICE *  10 ** (ERC20(baseToken).decimals()));
        if (vest[msg.sender].isValid) {
            vest[msg.sender].amount += _amount;
        } else {
            vest[msg.sender].amount = _amount;
        }
        vest[msg.sender].releasetime = block.timestamp + freeze_period;
    }

    function set_ratio(uint256 _ratio) public {
        require(msg.sender == dev, "!dev");
        ratio = _ratio;
    }

    function buy_direct(uint256 _usdt_amount) public onlyEOA {
        uint256 _one_amount = _usdt_amount * ratio;
        uint256 balance_one = IERC20(farmingToken).balanceOf(address(this));
        uint256 balance_usdt = IERC20(baseToken).balanceOf(msg.sender);
        require(balance_one > _one_amount, "amount exceed");
        require(balance_usdt > _usdt_amount, "amount exceed");
        IERC20(baseToken).transferFrom(msg.sender, address(this), _usdt_amount *  10 ** (ERC20(baseToken).decimals()));
        IERC20(farmingToken).transfer(msg.sender, _one_amount * 10 ** (ERC20(farmingToken).decimals()));
    }

    function getCurrentTimestamp() view external returns(uint256){
        require(msg.sender == dev, "!dev");
        return block.timestamp;
    }

    function getReleaseTime() public view virtual returns (uint256) {
        return vest[msg.sender].releasetime;
    }

    function getFreezeToken() public view virtual returns (uint256) {
        return vest[msg.sender].amount;
    }

    function release() public {
        require(block.timestamp >= vest[msg.sender].releasetime, "not release time");
        require(vest[msg.sender].amount > 0, "amount is zero");
        uint256 relase_amount = vest[msg.sender].amount;
        vest[msg.sender].amount = 0;
        vest[msg.sender].releasetime = 0;
        IERC20(farmingToken).transfer(msg.sender, relase_amount * 10 ** (ERC20(farmingToken).decimals()));
    }
}

